import * as React from "react";

interface ICount {
  count: number;
  //   State: number;
}

// interface IState {
//   State: number;
// }

class Counter extends React.Component<ICount> {
  state: ICount = {
    count: 0,
  };
  CountUp = () => {
    this.setState({});
  };
  CountDown = () => {};
  render() {
    return (
      <div>
        <h1>프로필</h1>
        <button onClick={this.CountUp}>+</button>
        <div>{this.state.count}</div>
        <button onClick={this.CountDown}>-</button>
      </div>
    );
  }
}

export default Counter;
